import AssetsVolume from "./AssetsVolume";
import { assets } from "./data";

const totalReducer = Object.keys(assets)
  .map((item) => AssetsVolume(assets[item]))
  .reduce((acc, item) => {
    return acc + item;
  }, 0);

export const total = () => totalReducer;
